  render() {
    let title = 'Title';
    const changeTitle = () => {
      title = 'Title has changed';
      console.log(title);
    }
    return (
      <div className="text-center">
        <h2>{title}</h2>
        <button>Change Title</button>
      </div>
    );
  }
}

export default App;
